import React from "react";
import "./contact.css";
import map from "../../assets/map.png";

const Footer = () => {
  return (
    <div className="section__padding">
      <div className="contact__section">
        <div></div>
      </div>
      <div className="contact__section-map">
        <img src={map} />
      </div>
    </div>
  );
};

export default Footer;
